CREATE TABLE Address(
	AddressID int NOT NULL,
	AddressLine1 nvarchar(60) NOT NULL,
	AddressLine2 nvarchar(60) NOT NULL,
	City nvarchar(60) NOT NULL,
	StateProvince nvarchar(60) NOT NULL,
	CountyRegion nvarchar(60) NOT NULL,
	PostalCode nvarchar(60) NOT NULL,
    PRIMARY KEY (AddressID)
    );

CREATE TABLE Customer(
	CustomerID int NOT NULL,
	Title nvarchar(50) NULL,
	FirstName varchar(50) NULL,
	MiddleName varchar(50) NULL,
	LastName varchar(50) NULL,
	Suffix varchar(20) NULL,
	CompanyName varchar(150) NULL,
	SalesPerson varchar(50) NULL,
	EmailAddress nvarchar(50) NULL,
	Phone varchar(50) NULL,
	PasswordHash varchar(50) NULL,
	PasswordSalt varchar(50) NULL,
    PRIMARY KEY(CustomerID)
    );

CREATE TABLE CustomerAddress(
	CustomerID int NOT NULL,
	AddressID int NOT NULL,
	AddressType nvarchar(50) NOT NULL,
	Customer_Address_ID varchar(50) NOT NULL,
    PRIMARY KEY(Customer_Address_ID)
    );

CREATE TABLE SAW.Product(
	ProductID int NOT NULL,
	Name varchar(50) NULL,
	ProductNumber nvarchar(50) NOT NULL,
	Color nvarchar(15) NULL,
	StandardCost DECIMAL(38,4) NOT NULL,
	ListPrice DECIMAL(38,4) NOT NULL,
	Sze nvarchar(15) NULL,
	Weight nvarchar(15) NULL,
	ProductCategoryID int NULL,
	ProductModelID int NULL,
	SellStartDate datetime NOT NULL,
	SellEndDate datetime NULL,
    PRIMARY KEY (ProductID)
	);

CREATE TABLE SAW.ProductCategory(
	ProductCategoryID int NOT NULL,
	ParentProductCategoryID int NULL,
	Name varchar(50) NULL,
   PRIMARY KEY (ProductCategoryID)
	);

CREATE TABLE SAW.ProductDescription(
	ProductDescriptionID int NOT NULL,
	Description nvarchar(255) NULL,
    PRIMARY KEY (ProductDescriptionID)
	);

CREATE TABLE SAW.ProductModel(
	ProductModelID int NOT NULL,
	Name varchar(50) NULL,
    PRIMARY KEY (ProductModelID)
	);

CREATE TABLE SAW.ProductModelProductDescription(
	ProductModelID int NULL,
	ProductDescriptionID int NOT NULL,
	Culture varchar(50) NULL,

    PRIMARY KEY (ProductDescriptionID)
	);

CREATE TABLE SAW.SalesOrderDetail(
	SalesOrderID int NOT NULL,
	SalesOrderDetailID int NOT NULL,
	OrderQty smallint NOT NULL,
	ProductID int NOT NULL,
	UnitPrice DECIMAL(38,4) NOT NULL,
	UnitPriceDiscount float NULL,
    PRIMARY KEY (SalesOrderDetailID)
	);

CREATE TABLE SAW.SalesOrderHeader(
	SalesOrderID int NOT NULL,
	RevisionNumber tinyint NOT NULL,
	OrderDate datetime NOT NULL,
	DueDate datetime NOT NULL,
	ShipDate datetime NOT NULL,
	Status tinyint NOT NULL,
	SalessOrderNumber nvarchar(23) NULL,
	PurchaseOrderNumber nvarchar(23) NULL,
	AccountNumber nvarchar(23) NULL,
	CustomerID int NOT NULL,
	ShipToAddressID int NOT NULL,
	BillToAddressID int NOT NULL,
	ShipMethod varchar(50) NULL,
	SubTotal DECIMAL(38,4) NOT NULL,
	TaxAmt DECIMAL(38,4) NOT NULL,
	Freight DECIMAL(38,4) NOT NULL,
	Commnt nvarchar(128) NULL,
    PRIMARY KEY (SalesOrderID)
	);
;
