INSERT INTO SAW.ProductDescription (ProductDescriptionID, Description) VALUES 
(3, 'Chromoly steel.')
, (4, 'Aluminum alloy cups; large diameter spindle.')
, (5, 'Aluminum alloy cups and a hollow axle.')
, (8, 'Suitable for any type of riding, on or off-road. Fits any budget. Smooth-shifting with a comfortable ride.')
, (64, 'This bike delivers a high-level of performance on a budget. It is responsive and maneuverable, and offers peace-of-mind when you decide to go off-road.')
, (88, 'For true trail addicts. An extremely durable bike that will go anywhere and keep you in control on challenging terrain - without breaking your budget.')
, (128, 'Serious back-country riding. Perfect for all levels of competition. Uses the same HL Frame as the Mountain-100.')
, (168, 'Top-of-the-line competition mountain bike. Performance-enhancing options include the innovative HL Frame, super-smooth front suspension, and traction for all terrain.')
, (170, 'Suitable for any type of off-road trip. Fits any budget.')
, (209, 'Entry level adult bike; offers a comfortable ride cross-country or down the block. Quick-release hubs and rims.')
, (249, 'Value-priced bike with many features of our top-of-the-line models. Has the same light, stiff frame, and the quick acceleration we''re famous for.')
, (320, 'Same technology as all of our Road series bikes, but the frame is sized for a woman. Perfect all-around bike for road or racing.')
, (321, 'Same technology as all of our Road series bikes. Perfect all-around bike for road or racing.')
, (337, 'A true multi-sport bike that offers streamlined riding and a revolutionary design. Aerodynamic design lets you ride with the pros, and the gearing will conquer hilly roads.')
, (375, 'Cross-train, race, or just socialize on a sleek, aerodynamic bike. Advanced seat technology provides comfort all day.')
, (376, 'Cross-train, race, or just socialize on a sleek, aerodynamic bike designed for a woman. Advanced seat technology provides comfort all day.')
, (409, 'Alluminum-alloy frame provides a light, stiff ride, whether you are racing in the velodrome or on a demanding club ride on country roads.')
, (457, 'This bike is ridden by race winners. Developed with the Adventure Works Cycles professional race team, it has a extremely light heat-treated aluminum frame, and steering that allows precision control.')
, (513, 'All-occasion value bike with our basic comfort and safety features. Offers wider, more stable tires for a ride around town or weekend trip.')
, (554, 'The plush custom saddle keeps you riding all day, and there''s plenty of space to add panniers and bike bags to the newly-redesigned carrier. This bike has stability when fully-loaded.')
, (594, 'Travel in style and comfort. Designed for maximum comfort and safety. Wide gear range takes on all hills. High-tech aluminum alloy construction provides durability without added weight.')
, (613, 'Superior shifting performance.')
, (618, 'Super rigid spindle.')
